(36765, 1, 653, N'
                        Универсальный антифриз SINTEC MULTI FREEZE изготовлен по уникальной гибридной технологии, которая сочетает преимущества карбоксилатных и силикатных антифризов. Антифриз производится на основе моноэтиленгликоля и пакета многопрофильных присадок с органическими и неорганическими добавками.
                        SINTEC MULTI FREEZE может применяться ВО ВСЕХ ТИПАХ двигателей и моделей автомобилей.
                        За счет применения новейших пакетов присадок, новый антифриз полностью совместим со всеми металлами и полимерными материалами. Устойчив к кавитации.
                        SINTEC MULTI FREEZE полностью совместим с ЛЮБЫМИ качественными охлаждающими жидкостями.
                        Это позволяет, в случае необходимости, использовать его в качестве доливочной жидкости в систему охлаждения и использовать при замене охлаждающей жидкости в системе охлаждения независимо от того, какой тип антифриза использовался ранее.
                        SINTEC MULTI FREEZE рассчитан НА ВЕСЬ СРОК эксплуатации автомобиля.
