(33617, 1, 653, N'
                        Охлаждающая жидкость, предназначенная для использования в системах охлаждения двигателей внутреннего сгорания отечественного и зарубежного производства. Базовыми компонентами продукта являются этиленгликоль и деминерализованная вода, которые обеспечивают хорошие теплоотводящие свойства, высокую температуру кипения и низкую температуру замерзания. Пакет присадок изготавливается из традиционных неорганических ингибиторов коррозии с ограниченным содержанием силикатов, что в комплексе обеспечивает эффективную защиту от коррозии, пенообразования, набухания резины и уплотнений. Изготавливается по СТО 15258135-005-2015 (в соответствии с ASTM D3306). Обеспечивает качественную защиту системы охлаждения двигателя от коррозии. Препятствует образованию накипи. Продукт инертен по отношению к резиновым изделиям и различным металлам, в том числе к алюминию. Рекомендуемый срок эксплуатации – 40 000 км пробега или два года, что наступит ранее.
