(36761, 1, 653, N'     Антифриз SINTEC EURO – охлаждающая жидкость последнего поколения, созданная на основе высококачественного моноэтиленгликоля и импортных ингибиторов коррозии. Применяется в системе охлаждения легковых автомобилей отечественного и зарубежного производства, грузовиков и других транспортных средств со средними и тяжелыми условиями эксплуатации. Обеспечивает правильный тепловой режим эксплуатации двигателя, предотвращает появление коррозии и отложений в системе охлаждения. Не допускает замерзания, перегрева, выкипания и появления воздушных пробок. Обладает эффективными смазывающими свойствами, продлевающими ресурс водяного насоса. Не повреждает шланги, прокладки и уплотнения системы охлаждения.', 6, '2019-08-21T07:45:35.8913835Z', N'Антифриз SINTEC Евро  1кг G11 (зеленый)', N'https://lastochka.market/upload/iblock/c99/c99c71a27cccd7e4a654752a4494c494.jpg', 140.0),
