                        Антифриз SINTEC GOLD – охлаждающая жидкость последнего поколения, созданная на основе высококачественного этиленгликоля и универсального пакета присадок.
                        Применяется в системе охлаждения легковых автомобилей отечественного и зарубежного производства, грузовиков и других транспортных средств, со средними и тяжелыми условиями эксплуатации. Обеспечивает правильный тепловой режим эксплуатации двигателя, предотвращает появление коррозии и отложений в системе охлаждения.
                        Защищает от замерзания до -40°С, от появления воздушных пробок. Не повреждает шланги, прокладки и уплотнения системы охлаждения. Антифриз не содержит в своем составе нитритов и аминов.
