(33962, 1, 639, N'     Антисон для водителей представляет собой небольшой пластиковый прибор, предназначенный для повышения концентрации водителя за рулём. Перед началом работы вам следует переключить штекер в положение ON, проверить состояние, закрепить вещицу за правым ухом и сесть за руль. Если во время ночной поездки голова начнёт опускаться от нехватки сна, резкий звук разбудить незадачливого шофёра и объяснит ему, что следует припарковаться при первой же возможности и лечь поспать. Маленький аксессуар может не просто помочь, но и спасти жизнь, благодаря оповещению, как только автолюбитель почувствует первые признаки сна. Предмет не работает на повороты головы по сторонам.', 5, '2019-08-21T07:45:35.8906005Z', N'Антисон TORSO, устройство со звуковым сигналом', N'https://lastochka.market/upload/iblock/f2b/f2bef6596a60487c9050833d28d9aadd.jpg', 131.0),
