(38608, 1, 714, N'
                        Total LICAL EP 2 — многоцелевая смазка с загустителем на основе литиево-кальциевого мыла. Обладает высокой стойкостью к выдавливанию.
                        Применение
                        ?? Многоцелевая смазка LICAL EP 2 используется для смазывания различного промышленного оборудования, работающего во влажных или сухих условиях, а также при наличии пыли и других загрязнений.
                        ?? Total LICAL EP 2 может применяться во внедорожной технике, работающей в условиях частого контакта смазки с водой, в качестве смазки с ЕР свойствами для смазывания, например, втулок поршневых пальцев, коронных шестерен, гусеничных колес экскаваторов.
                        ?? В процессе эксплуатации следует избегать загрязнения смазки пылью или грязью. В особенно неблагоприятных условиях предпочтительнее использовать пневматические нагнетательные системы или картриджи.
                        Спецификации
                        ?? ISO 6743-9: L-XBDHB 2
                        ?? DIN 51 502: KP2K -25
